"  <div class=\"figure\" style=\"width: 532px\">",
"   <div class=\"ttl\">",
"    Endoscopic appearance of targeted ablation of the entire esophageal circumference for Barrett's esophagus at the top of the gastric folds using the HALO90 system",
"   </div>",
"   <div class=\"cntnt\" style=\"width: 512px; height: 294px; background-image: url(data:image/jpeg;base64,);\">",
"   </div>",
"   <div class=\"lgnd\">",
"    <strong>",
"     (A, B)",
"    </strong>",
"    High-resolution white light inspection of the neosquamocolumnar junction after primary circumferential ablation. Differentiating Barrett's mucosa from cardia mucosa can be difficult.",
"    <br>",
"     <strong>",
"      (C)",
"     </strong>",
"     Corresponding image with narrow band imaging.",
"     <br>",
"      <strong>",
"       (D)",
"      </strong>",
"      To ensure eradication of all intestinal metaplasia at the top of the gastric folds, the entire circumference is ablated using the HALO90 system. After the first ablation pass, whitish coagulum can be seen.",
"      <br>",
"       <strong>",
"        (E, F)",
"       </strong>",
"       After cleaning of the ablation zone and electrode surface, the entire neosquamocolumnar junction is ablated a second time.",
