"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Risk and protective factors for developing breast cancer",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1\" colspan=\"1\" rowspan=\"2\">",
"        &nbsp;",
"       </td>",
"       <td class=\"subtitle1\" colspan=\"3\" rowspan=\"1\">",
"        Risk",
"group",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2\">",
"        Low risk",
"       </td>",
"       <td class=\"subtitle2\">",
"        High risk",
"       </td>",
"       <td class=\"subtitle2\">",
"        Relative risk",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Risk factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Deleterious BRCA1/BRCA2 genes",
"       </td>",
"       <td>",
"        Negative",
"       </td>",
"       <td>",
"        Positive",
"       </td>",
"       <td>",
"        3.0 to 7.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Mother or sister with breast cancer",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        2.6",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age",
"       </td>",
"       <td>",
"        30 to 34",
"       </td>",
"       <td>",
"        70 to 74",
"       </td>",
"       <td>",
"        18.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age at menarche",
"       </td>",
"       <td>",
"        &gt;14",
"       </td>",
"       <td>",
"        &lt;12",
"       </td>",
"       <td>",
"        1.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age at first birth",
"       </td>",
"       <td>",
"        &lt;20",
"       </td>",
"       <td>",
"        &gt;30",
"       </td>",
"       <td>",
"        1.9 to 3.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Age at menopause",
"       </td>",
"       <td>",
"        &lt;45",
"       </td>",
"       <td>",
"        &gt;55",
"       </td>",
"       <td>",
"        2.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Use of contraceptive pills",
"       </td>",
"       <td>",
"        Never",
"       </td>",
"       <td>",
"        Past/current use",
"       </td>",
"       <td>",
"        1.07 to 1.2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        HRT (estrogen + progestin)",
"       </td>",
"       <td>",
"        Never",
"       </td>",
"       <td>",
"        Current",
"       </td>",
"       <td>",
"        1.2",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Alcohol",
"       </td>",
"       <td>",
"        None",
"       </td>",
"       <td>",
"        2",
"to 5 drinks/day",
"       </td>",
"       <td>",
"        1.4",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Breast",
"density on mammography (percents)",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        &ge;75",
"       </td>",
"       <td>",
"        1.8 to 6.0",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Bone",
"density",
"       </td>",
"       <td>",
"        Lowest quartile",
"       </td>",
"       <td>",
"        Highest",
"quartile",
"       </td>",
"       <td>",
"        2.7 to 3.5",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        History",
"of a benign breast biopsy",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        1.7",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        History",
"of atypical hyperplasia on biopsy",
"       </td>",
"       <td>",
"        No",
"       </td>",
"       <td>",
"        Yes",
"       </td>",
"       <td>",
"        3.7",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\" colspan=\"4\" rowspan=\"1\">",
"        Protective",
"factors",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Breast feeding (months)",
"       </td>",
"       <td>",
"        &ge;16",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0.73",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        Parity",
"       </td>",
"       <td>",
"        &ge;5",
"       </td>",
"       <td>",
"        0",
"       </td>",
"       <td>",
"        0.71",
"       </td>",
"      </tr>",
